import BarChart from "../components/Charts/BarChart";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import { useItnl } from "react-intl";

const DashboardPage = () => {
	return (
		<Grid container spacing={2} sx={{ m: 2 }}>
			<Grid item xs={12} sm={8} md={6} lg={6} component={Paper} elevation={6}>
				<BarChart
					text={"World's largest cities per 2021"}
					subtitle={
						'Source: <a href="https://worldpopulationreview.com/world-cities" target="_blank">World Population Review</a>'
					}
					yAxisTitle={"Population (millions)"}
					tooltip={"Population in 2021: <b>{point.y:.1f} millions</b>"}
					DataName={"Population"}
				></BarChart>
			</Grid>
		</Grid>
	);
};

export default DashboardPage;
